import React from "react";

import Html1 from "../src/image/service2.png";
import Html2 from "../src/image/service3.png";
import Programs from "../src/image/service3.png";
import Logo from "../src/image/service4.png";
import Taj from "../src/image/service5.png";


const Sdata = () => {
    return (
        [
            {
                imgsrc : Taj,
                title: "Website Creations",
            }, 

            {
                imgsrc : Logo,
                title: "Programming",
            },

            {
                imgsrc : Programs,
                title: "C Programming",   
            },

            {
                imgsrc : Html1,
                title: "Html Courses",   
            },

            {
                imgsrc : Html2,
                title: "HTML CSS JS",   
            },

            {
                imgsrc : Taj,
                title: "Website Creations",
            },

        ]
    )
}

export default Sdata;
